import React from 'react';

const SearchBar3 = () => {
  return (
    <div className="flex flex-col md:flex-row items-center justify-center p-4 rounded-md shadow-md bg-gray-800 space-y-2 md:space-y-0 md:space-x-2">
      <select className="w-full md:w-auto bg-gray-700 text-white p-2 rounded-md focus:outline-none focus:ring focus:border-blue-300">
        <option>Selecciona Ciudad</option>
      </select>
      <select className="w-full md:w-auto bg-gray-700 text-white p-2 rounded-md focus:outline-none focus:ring focus:border-blue-300">
        <option>Categoría</option>
      </select>
      <input
        type="text"
        placeholder="¿Qué buscas?"
        className="w-3/5 md:w-auto bg-gray-700 text-white p-2 rounded-md focus:outline-none"
      />
    </div>
  );
};

export default SearchBar3;
